 min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1869584","type":"CustomJS"},{"attributes":{"source":{"id":"1869233"}},"id":"1869500","type":"CDSView"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1869552","type":"BoxAnnotation"},{"attributes":{"format":"0.[00]%"},"id":"1869436","type":"NumeralTickFormatter"},{"attributes":{},"id":"1869440","type":"DataRange1d"},{"attributes":{},"id":"1869221","type":"RedoTool"},{"attributes":{"data":{"Close":{"__ndarray__":"hetRuB5FSkDsUbgehYtJQM3MzMzMzElAuB6F61HYSkDXo3A9CndLQAAAAAAAgEtAKVyPwvUoTEAfhetRuB5MQArXo3A9KkxA9ihcj8L1TECamZmZmRlNQEjhehSu50xAhetRuB5FTUAzMzMzM9NMQOxRuB6Fq01AuB6F61E4TUBxPQrXo1BMQB+F61G4fkxAMzMzMzPTTECuR+F6FM5MQIXrUbge5UxAexSuR+FaTUBcj8L1KJxNQBSuR+F6dE5AzczMzMwsT0BmZmZmZqZPQFyPwvUoXE9AcT0K16OQT0B7FK5H4bpPQK5H4XoUzk9AexSuR+FKUEAK16NwPS
